/* eslint-disable jsx-a11y/anchor-is-valid */
import './StoresTop.scss';

export const StoresTop = () => {
  return (
    <>
      <div className="breadcrumb">
        <ul>
          <li>
            <a href="/" title="">
              Ana səhifə
            </a>
          </li>
          <li>
            <a href="" title="">
              Mağazalar
            </a>
          </li>
        </ul>
      </div>
      <h1 className="section-title">Mağazalar</h1>
    </>
  );
};
